from aoc import main
import string

INPUT = ""

def react(s: list[str], c: str = '') -> int:
  s = [x for x in s if x != c and x != c.upper()]
  for i in range(len(s)-1, -1, -1):
    if i+1 >= len(s):
      continue
    if s[i] != s[i+1] and s[i].upper() == s[i+1].upper():
      s.pop(i)
      s.pop(i)
  return len(s)

def solve() -> tuple[int,int]:
  part2 = min(react(list(INPUT), c) for c in string.ascii_lowercase)
  return react(list(INPUT)), part2

main(solve)
